import React from "react";
import "./Header.css";
import { Link } from "react-router-dom";

export default function Header() {
  return (
    <header>
      <h1 className="name">Michelle X Liu</h1>
      <div className="nav-container">
        <Link to="/">About</Link>
        <Link to="/work">Work</Link>
        <Link to="/play">Play</Link>
      </div>
    </header>
  );
}
